import Footer from "../../components/footer/Footer";
import Header from "../../components/header/Header";
import YoutubeEmbed from "../../components/ytembed/YoutubeEmbed";

function Home() {
  return (
    <>
      <Header />
      <div className="top_info">
        <YoutubeEmbed className="" embedId="#"/>
      </div>
      <Footer />
    </>
  );
}

export default Home;
